import logo from "./logo.svg";
import "./App.css";
import { useEffect } from "react";

function App() {
  const [articles, setArticles] = useState([]);

  const getArticles = async () => {
    try {
      const res = await axios.get("http://localhost:4000/");
      setArticles(res.data);
    } catch (error) {
      console.log(error);
    }
  };
  console.log({ articles });
  useEffect(() => {
    getArticles();
  }, []);
  return <>RSS - Feed</>;
}

export default App;
